import React from "react";

import PropTypes from "prop-types";

import "./navigation-links.css";

import { Link } from "react-router-dom";
import { BrowserRouter as Router, Route } from "react-router-dom";

const NavigationLinks = (props) => {
  return (
    <nav className={`navigation-links-nav ${props.rootClassName} `}>
      <Link to="/" className="navbar-link">
        {" "}
        {props.text}
      </Link>

      <span className="navigation-links-text1 navbar-link">{props.text1}</span>
      <Link to="/pricing" className="navigation-links-text2 navbar-link">
        {props.text2}
      </Link>
      <span className="navigation-links-text3 navbar-link">{props.text3}</span>
      <Link to="/faqs" className="navigation-links-text4 navbar-link">
        {props.text4}
      </Link>

      <div className={`navigation-links-nav ${props.rootClassName} `}>
        <div className="dropdown">
          <button className="dropbtn">
            Dropdown
            <i className="fa fa-caret-down"></i>
          </button>
          <div className="dropdown-content">
            <div className="header">
              <h2>Mega Menu</h2>
            </div>
            <div className="row">
              <div className="column">
                <h3>Category 1</h3>
                <a href="#">Link 1</a>
                <a href="#">Link 2</a>
                <a href="#">Link 3</a>
              </div>
              <div className="column">
                <h3>Category 2</h3>
                <a href="#">Link 1</a>
                <a href="#">Link 2</a>
                <a href="#">Link 3</a>
              </div>
              <div className="column">
                <h3>Category 3</h3>
                <a href="#">Link 1</a>
                <a href="#">Link 2</a>
                <a href="#">Link 3</a>
              </div>
            </div>
          </div>
        </div>
      </div>
    </nav>
  );
};

NavigationLinks.defaultProps = {
  text2: "Pricing",
  text3: "Features",
  rootClassName: "",
  text4: "FAQS",
  text: "Home",
  text1: "Resources",
};

NavigationLinks.propTypes = {
  text2: PropTypes.string,
  text3: PropTypes.string,
  rootClassName: PropTypes.string,
  text4: PropTypes.string,
  text: PropTypes.string,
  text1: PropTypes.string,
};

export default NavigationLinks;
